import './SearchForm.css';
import React from 'react';

function SearchForm() {
  return (
    <section className='search-form'>
      <div className='search-form__container'>
        <div className='search-form__rectangle'>
          <div className='search-form__search-elements'>
            <img className='search-form__search-icon' src="" alt="" />
            <p className='search-form__search-text'></p>
          </div>
          <div className='search-form__search-items'></div>
        </div>
      </div>
    </section>
  );
}

export default SearchForm;
